        <TextInput style={styles.superMarketSearchInput}></TextInput>
        {iconHelper("AntDesign", "search1", 20, "green")}
      </View>
      <Text>Hi from StoreView</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  superMarketLogo: {
    width: 100,
